import React from 'react';
import classes from './Project.module.css';
import Pic from '../../../assets/images/logo192.png';

const project = (props) => (
    <div className={classes.Project}>
        <p>{props.title}</p>
        <img src={Pic} />
        <p>{props.desc}</p>
    </div>
)

export default project;
